INSERT INTO `AVAL_PERGUNTA` VALUES (1,1,1,1,'Executa movimentos geis e com naturalidade em todos as reas (checkout,\nseparao, caixas e recebimento). *','Ativo'),(2,1,1,2,'Cumpre e/ou colabora para o cumprimento das metas e resultados relacionados\n velocidade de produo e entregas dentro do prazo. *','Ativo'),(3,1,1,3,'Transmite segurana na conferncia de itens (no estoque, mesa e/ou\nrecebimento), fazendo-o de forma consistente e assertiva. *','Ativo'),(4,1,1,4,'Demonstra ateno aos detalhes e qualidade ao lidar com produtos, caixas,\nferramentas de trabalho e processos em geral. *','Ativo'),(5,1,1,5,'Demonstra que conhece e respeita os procedimentos e padres da Evino em\ntodas as reas em que atua, sem cometer equvocos ou gerar falhas processuais.\n*','Ativo'),(6,1,1,6,'Demonstra zelo e cuidado pela integridade e higiene do local e instrumentos de\ntrabalho. *','Ativo'),(7,1,1,7,'Colabora para a manuteno de uma organizao eficiente e de acordo com os\npadres. Mantm cada coisa em seu lugar e no melhor lugar possvel\n(instrumentos de trabalho, caixas, pallets, etiquetas, notas, ondas, etc). *','Ativo'),(8,1,1,8,'Demonstra facilidade em aprender e entender os direcionamentos que so\npassados, bem como assimilar novos processos. *','Ativo'),(9,1,1,9,'Para a execuo de todas as atribuies do cargo, demonstra j possuir os\nconhecimentos bsicos necessrios: endereo de estoque, separao,\npaletizao, planilha de pedidos com problemas, etc. *','Ativo'),(10,1,1,10,'Entende e soluciona os problemas que acontecem com autonomia. *','Ativo'),(11,2,1,11,'Refere-se  empresa como \"ns\". Demonstra brilhos nos olhos por fazer parte do\ntime. *','Ativo'),(12,2,1,12,'Fomenta uma boa imagem da empresa interna e externamente. No reclama por\nreclamar. Ao invs disso, prope melhorias e aponta solues com\nresponsabilidade. *','Ativo'),(13,2,1,13,'Demonstra atitude enrgica e dinmica durante o trabalho, fazendo primeiro o\nque  mais urgente antes que se torne um problema. *','Ativo'),(14,2,1,14,'Antecipa-se aos possveis problemas antes que aconteam.  proativo e tem\nmuita iniciativa. *','Ativo'),(15,2,1,15,'Demonstra preocupao e respeito aos procedimentos de segurana e\nutilizao de EPIs. *','Ativo'),(16,2,1,16,' atento(a), e no distrado(a), em sua movimentao e com o que acontece a\nsua volta, a fim de evitar ser vtima ou causador de qualquer acidente. *','Ativo'),(17,2,1,17,'Colabora para um bom clima e relacionamento da equipe. Trata os colegas com\nrespeito, educao e empatia. *','Ativo'),(18,2,1,18,'Ajuda e colabora com a equipe. Trabalha bem em grupo e sempre faz a sua\nparte. *','Ativo'),(19,3,1,1,'Demonstra ter domnio e conhecimentos de logstica de armazm e distribuio.\n*','Ativo'),(20,3,1,2,'Demonstra conhecimento de Informtica geral intermedirio, ao lidar com\nferramentas de e-mail, alimentao e leitura de planilhas, estruturao de\napresentaes bsicas e microsoft word quando necessrio. *','Ativo'),(21,3,1,3,'Utiliza de forma assertiva e eficiente as aplicaes, necessrias ao desempenho\nde suas atribuies, dentro dos sistemas de informao que so disponibilizados\n(SAP, Looker, Zed, Evinops). *','Ativo'),(22,3,1,4,'Realiza uma comunicao oral assertiva, se fazendo entender com facilidade,\nobjetividade e bom senso. *','Ativo'),(23,3,1,5,'Realiza uma comunicao escrita assertiva, via e-mail, chat interno ou\ndocumentaes. Utiliza o canal escrito na hora certa, consegue se fazer\nentender e escreve com qualidade (potuao e gramtica). *','Ativo'),(24,3,1,6,'Comunica-se com bom senso, empatia e transparncia: levanta informaes\nantes de tirar concluses precipitadas, repassa informaes assertivas,\ncompartilha informaes e envolve as pessoas certas nos assuntos certos. *','Ativo'),(25,3,1,7,'Prioriza as tarefas de forma eficiente, sendo capaz de se organizar para cumprir\ncom suas atribuies dentro dos prazos e alcanar os objetivos da rea. *','Ativo'),(26,3,1,8,'Mantm seu ambiente de trabalho, instrumentos e documentaes bem\norganizados. *','Ativo'),(27,3,1,9,'Demonstra ate